 const questionInput = document.getElementById("questionInput"); // ô nhập câu hỏi
 const suggestion = document.getElementById("suggestion"); // gợi ý
 const answer = document.getElementById("answer"); // câu trả lời
 
 questionInput.addEventListener("input", function () {
   const inputText = questionInput.value.toLowerCase(); // lấy giá trị và chuyển về chữ thường
   suggestion.innerHTML = ""; // xóa gợi ý cũ
 
   if (inputText.length === 0) {
     answer.innerHTML = ""; // nếu không có giá trị nhập vào, xóa câu trả lời
     return;
   }
 
   const matchingItems = data.filter(
     (item) => item.Name.toLowerCase().includes(inputText) // tìm các mục phù hợp
   );
 
   if (matchingItems.length > 0) {
     matchingItems.forEach((item) => {
       const suggestionItem = document.createElement("div");
       suggestionItem.textContent = item.Name; // hiển thị tên sản phẩm
       suggestion.appendChild(suggestionItem); // thêm vào gợi ý
     });
     suggestion.style.display = "block"; // hiển thị gợi ý
   } else {
     suggestion.style.display = "none"; // ẩn gợi ý nếu không tìm thấy mục nào phù hợp
   }
 });
 
 suggestion.onclick = (event) => {
   if (event.target.tagName === "DIV") {
     const selectedProductName = event.target.textContent; // lấy tên sản phẩm đã chọn
     const selectedItem = data.find(
       (item) => item.Name === selectedProductName
     ); // tìm mục trong dữ liệu có tên sản phẩm tương ứng
     const formattedAnswer = `
     <div>Tên: ${selectedItem.Name}</div>
     <div>SKU: ${selectedItem.SKU}</div>
     <div>PLU: ${selectedItem.UPC}</div>
   `; // tạo câu trả lời định dạng
 
     questionInput.value = ""; // Xóa giá trị trong ô nhập
     answer.innerHTML = formattedAnswer; // hiển thị câu trả lời
     suggestion.style.display = "none"; // ẩn gợi ý
   }
 };